import { useEffect, useState } from "react";
import Card from "../../components/Card";
import api from "../../services/api";

import "./index.css";

export default function Main() {
  const [carros, setCarros] = useState({});
  const [card, setCard] = useState([]);
  let arrayCard = [];

  api.then((e) => {
    setCarros(e);
  });
  useEffect(() => {
    handleCards();
  }, []);

  function handleCards() {
    if (Object.values(carros).length == 0) {
      console.log("Aguarde");
    } else {
      let sectionList = document.querySelector('#lista-de-veiculos')
      console.log(sectionList);
      for (let i = 0; i <= Object.values(carros).length - 1 ; i++) {
        sectionList += <Card
        marca={carros[i].marca}
        veiculo={carros[i].veiculo}
        ano={carros[i].ano}
        />
        // console.log(<Card/>)
        // arrayCard.push(
        // );
      }
    }
    setCard(arrayCard);
  }

  return (
    <div className="container-main">
      <div className="container-section">
        <div className="lista">
          <p className="title-section">Lista de ve√≠culos</p>
          <button onClick={handleCards}>Atualizar Lista</button>
        </div>
        <section id="lista-de-veiculos">
          {card}
        </section>
      </div>

      <div className="container-section">
        <p className="title-section">Detalhes</p>
        <section id="detalhes">Lorem Ipsum</section>
      </div>
    </div>
  );
}
